import { NavLink } from "react-router-dom";
import React from "react";
import axios from "axios";
import { Dropdown } from "react-bootstrap";
class Navigation extends React.Component {
    constructor() {
        super();
        this.funisauthenticated();
    }
    state = {
        Isauthenticated: true
    }
    funisauthenticated = () => {
        axios.get("http://localhost:3001/users").then((res) => { this.setState({ Isauthenticated: res.data.isauthenticated }) });
    }

    LinkHome() {
        return (
            <li className="nav-item">
                <NavLink className="nav-link" to="/">
                    Home
                    <span className="sr-only">(current)</span>
                </NavLink>
            </li>)
    }
    LinkAbout() {
        return (
            <li className="nav-item">
                <NavLink className="nav-link" to="/about">
                    About
                </NavLink>
            </li>
        )
    }
    LinkSignUp() {
        return (
            <li className="nav-item">
                <NavLink className="nav-link" to="/signup">
                    SignUp
                </NavLink>
            </li>
        )
    }
    LinkSignIn() {
        return (
            <li className="nav-item">
                <NavLink className="nav-link" to="/signin">
                    SignIn
                </NavLink>
            </li>
        )
    }
    LinkContact() {
        return (
            <li className="nav-item">
                <NavLink className="nav-link" to="/contact">
                    Contact
                </NavLink>
            </li>
        )
    }
    Dropdown = () => {
        return (
            <Dropdown>
                <Dropdown.Toggle variant="primary" id="dropdown-basic">
                    Dropdown Button
                </Dropdown.Toggle>

                <Dropdown.Menu>
                    <Dropdown.Item href="/contact">Action</Dropdown.Item>
                    <Dropdown.Item href="/About">Doctors</Dropdown.Item>
                    <Dropdown.Item href="/contact">Something else</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
        )
    }

    render() {
        return (
            <Navbar bg="light" expand="lg">
  <Container>
    <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="me-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <Nav.Link href="#link">Link</Nav.Link>
        <NavDropdown title="Dropdown" id="basic-nav-dropdown">
          <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown>
      </Nav>
    </Navbar.Collapse>
  </Container>
</Navbar>
        );
    }
}
export default Navigation;
